import React from "react";

const Pokedex = () => {
  return (
    <main className="App-home">
      <div>Pokedex Here</div>
      <a
        className="App-link"
        href="https://reactjs.org"
        target="_blank"
        rel="noopener noreferrer"
      >
        Enter Here
      </a>
    </main>
  );
};

export default Pokedex;
